  input: 'TEXT,F3XT,,"Dear Alyssa: The following is a brief descripton of the transactions
    that you and I have diiscussed prior to filing this termination report.  As I
    mentioned, the committee had not previously reported service charges for its bank
    account with the National Bank of Commerce.  In 1998, those fees totalled $97.98,
    in 2004 they were $136.70 and charges thus far incurred in 2005 are $7.79 for
    a total of service fees of $242.47.  Additionally, I failed to report a contribution
    of $2,500 to John Tanner on October 15, 2001.  Mr. Tanner was a candidate for
    the U. S. House.  Finally, I am reporting a disbursement from 1994 from the account
    involving an overpayment to our then President & CEO.  He exceeded the $5,000
    limit by $2,100.  The $2,100 was removed from the committee''s account and deposited
    in the Company''s state political action committee (Vestpac State Political Action
    Committee) account.  As always, please let me know if you have any quesitons.  I
    greatly appreciate your help in terminating our pac.  Sincerely, Rob McLaughlin"'
